anguageName\":{\"simpleText\":\"Southern Sotho\"}},{\"languageCode\":\"es\",\"languageName\":{\"simpleText\":\"Spanish\"}},{\"languageCode\":\"su\",\"languageName\":{\"simpleText\":\"Sundanese\"}},{\"languageCode\":\"sw\",\"languageName\":{\"simpleText\":\"Swahili\"}},{\"languageCode\":\"sv\",\"languageName\":{\"simpleText\":\"Swedish\"}},{\"languageCode\":\"tg\",\"languageName\":{\"simpleText\":\"Tajik\"}},{\"languageCode\":\"ta\",\"languageName\":{\"simpleText\":\"Tamil\"}},{\"languageCode\":\"tt\",\"languageName\":{\"simpleText\":\"Tatar\"}},{\"languageCode\":\"te\",\"languageName\":{\"simpleText\":\"Telugu\"}},{\"languageCode\":\"th\",\"languageName\":{\"simpleText\":\"Thai\"}},{\"languageCode\":\"tr\",\"languageName\":{\"simpleText\":\"Turkish\"}},{\"languageCode\":\"tk\",\"languageName\":{\"simpleText\":\"Turkmen\"}},{\"languageCode\":\"uk\",\"languageName\":{\"simpleText\":\"Ukrainian\"}},{\"languageCode\":\"ur\",\"languageName\":{\"simpleText\":\"Urdu\"}},{\"languageCode\":\"ug\",\"languageName\":{\"simpleText\":\"Uyghur\"}},{\"languageCode\":\"uz\",\"languageName\":{\"simpleText\":\"Uzbek\"}},{\"languageCode\":\"vi\",\"languageName\":{\"simpleText\":\"Vietnamese\"}},{\"languageCode\":\"cy\",\"languageName\":{\"simpleText\":\"Welsh\"}},{\"languageCode\":\"fy\",\"languageName\":{\"simpleText\":\"Western Frisian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"DgxGa7-hVsY\",\"title\":\"Can You Tell Them Apart? UKs Only Identical Quadruplets | Four of a Kind\",\"lengthSeconds\":\"2768\",\"keywords\":[\"bbc documentary\",\"origin story\",\"parenting\",\"wellbeing\",\"mindfulness\",\"support network\",\"shelter\",\"nct\",\"first second third trimester\",\"mums meet up\",\"charity for parents\",\"family lives\",\"kensington mums\",\"mind\",\"mums group\",\"mummy social\",\"raising a child\",\"snowplow parenting\",\"inuit parenting\",\"co parenting\",\"weird parenting wins\",\"respectful parenting\",\"quaruplets\",\"raising twins\",\"triplets\",\"four of a kind\",\"identical twins\",\"identical quads\",\"monochorionic quads\",\"twins\",\"child development\"],\"channelId\":\"UCIjUPDT85E1zkO_a6EGLeDQ\",\"isOwnerViewing\":false,\"shortDescription\":\"SUBSCRIBE to Origin: https:\/\/tinyurl.com\/y8v4u288\\n\\nHave you ever had to write your childs initials on them to remember which one was which? \\n\\nThe Carles household is home to four girls who are 4 of a kind but who also beat the odds of 64 million to one to survive. Ellie, Georgina, Jessica and Holly are Britains only identical quadruplets and their mum Julie was only the 27th woman in the world to conceive monochorionic quads naturally. The girls are so alike that for the first year Julie and her husband Jose had to write the babies initials on their feet in permanent marker to tell them apart, and Jose sometimes still struggles to know who is who it probably doesnt help that Mum dresses them all the same.\\n\\nUntil now, the girls didnt have much contact with life outside of their family. They are all each others best friends and work like a little mischief making machine, an inseparable unit working as one. But thats all about to change as the girls start their first year of primary school. \\n\\nThis documentary will follow their journey during their first year at school as they cause a lot of confusion and sometimes hostility wherever they go. With identical strawberry blonde corkscrew curls, the same faces and heights  they are impossible to tell apart and people often stare and ask some quite blunt questions about what its like to bring up four of a kind. This documentary will aim to answer these questions and also give insight into the uniqueness of identical quadruples. r the first year Julie and her husband Jose had to write the babies initials on their feet in permanent marker to tell them apart, and Jose sometimes still struggles to know who is who it probably doesnt help that Mum dresses them all the same.\n\nUntil now, the girls didnt have much contact with life outside of their family. They are all each others best friends and work like a little mischief making machine, an inseparable unit working as one. But thats all about to change as the girls start their first year of primary school. \n\nThis documentary will follow their journey during their first year at school as they cause a lot of confusion and sometimes hostility wherever they go. With identical strawberry blonde corkscrew curls, the same faces and heights  they are impossible to tell apart and people often stare and ask some quite blunt questions about what its like to bring up four of a kind. This documentary will aim to answer these questions and also give insight into the uniqueness of identical quadruples. How identical are they really?\n\n"},{"text":"#Monochorionic","navigationEndpoint":{"clickTrackingParams":"CJYBENzXBCITCL6wqYbinOoCFXUkTAoddY8NMw==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23Monochorionic","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#Monochorionic"}},"loggingDirectives":{"trackingParams":"CJYBENzXBCITCL6wqYbinOoCFXUkTAoddY8NMw==","visibility":{"types":"12"}}},{"text":" "},{"text":"#Quadruplets","navigationEndpoint":{"clickTrackingParams":"CJUBENzXBCITCL6wqYbinOoCFXUkTAoddY8NMw==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23Quadruplets","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#Quadruplets"}},"loggingDirectives":{"trackingParams":"CJUBENzXBCITCL6wqYbinOoCFXUkTAoddY8NMw==","visibility":{"types":"12"}}},{"text":"\n\nContent licensed from All3Media. For any enquiries, please contact us at info@passiondistribution  UKs Only Identical Quadruplets | Four of a Kind","lengthSeconds":"2768","keywords":["bbc documentary","origin story","parenting","wellbeing","mindfulness","support network","shelter","nct","first second third trimester","mums meet up","charity for parents","family lives","kensington mums","mind","mums group","mummy social","raising a child","snowplow parenting","inuit parenting","co parenting","weird parenting wins","respectful parenting","quaruplets","raising twins","triplets","four of a kind","identical twins","identical quads","monochorionic quads","twins","child development"],"channelId":"UCIjUPDT85E1zkO_a6EGLeDQ","isOwnerViewing":false,"shortDescription":"SUBSCRIBE to Origin: https://tinyurl.com/y8v4u288\n\nHave you ever had to write your childs initials on them to remember which one was which? \n\nThe Carles household is home to four girls who are 4 of a kind but who also beat the odds of 64 million to one to survive. Ellie, Georgina, Jessica and Holly are Britains only identical quadruplets and their mum Julie was only the 27th woman in the world to conceive monochorionic quads naturally. The girls are so alike that for the first year Julie and her husband Jose had to write the babies initials on their feet in permanent marker to tell them apart, and Jose sometimes still struggles to know who is who it probably doesnt help that Mum dresses them all the same.\n\nUntil now, the girls didnt have much contact with life outside of their family. They are all each others best friends and work like a little mischief making machine, an inseparable unit working as one. But thats all about to change as the girls start their first year of primary school. \n\nThis documentary will follow their journey during their first year at school as they cause a lot of confusion and sometimes hostility wherever they go. With identical strawberry blonde corkscrew curls, the same faces and heights  they are impossible to tell apart and people often stare and ask some quite blunt quest A3sOHuOPLGNCl-WbsaXQ"}},"microformat":{"playerMicroformatRenderer":{"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/DgxGa7-hVsY/maxresdefault.jpg","width":1280,"height":720}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/DgxGa7-hVsY","flashUrl":"http://www.youtube.com/v/DgxGa7-hVsY?version=3\u0026autohide=1","width":1280,"height":720,"flashSecureUrl":"https://www.youtube.com/v/DgxGa7-hVsY?version=3\u0026autohide=1"},"title":{"simpleText":"Can You Tell Them Apart? UKs Only Identical Quadruplets | Four of a Kind"},"description":{"simpleText":"SUBSCRIBE to Origin: https://tinyurl.com/y8v4u288\n\nHave you ever had to write your childs initials on them to remember which one was which? \n\nThe Carles household is home to four girls who are 4 of a kind but who also beat the odds of 64 million to one to survive. Ellie, Georgina, Jessica and Holly are Britains only identical quadruplets and their mum Julie was only the 27th woman in the world to conceive monochorionic quads naturally. The girls are so alike that for the first year Julie and her husband Jose had to write the babies initials on their feet in permanent marker to tell them apart, and Jose sometimes still struggles to know who is who it probably doesnt help that Mum dresses them all the same.\n\nUntil now, the girls didnt have much contact with life outside of their family. They are all each others best friends and work like a little mischief making machine, an inseparable unit working as one. But thats all about to change as the girls start their first year of primary school. \n\nThis documentary will follow their journey during their first year at school as they cause a lot of confusion and sometimes hostility wherever they go. With identical strawberry blonde corkscrew curls, the same faces and heights  they are impossible to tell apart and people often stare and ask some quite blunt questions about what its like to bring up four of a kind. This documentary will aim to answer these questions and also give insight into the uniqueness of identical quadruples. How identical are they really?\n\n#Monochorionic #Quadruplets\n\nContent licensed from All3Media. For any enquiries, please contact us at info@passiondistribution.com"},"lengthSeconds":"2769","ownerProfileUrl":"http://www.youtube.com/channel/UCIjUPDT85E1zkO_a6EGLeDQ","externalChannelId":"UCIjUPDT85E1zkO_a6EGLeDQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"3437764","category":"People \u0026 Blogs","publishDate":"2019-10-25","ownerChannelName":"Origin","uploadDate":"2019-10-25"}},"trackingParams":"CAAQu2kiEwipq6mG4pzqAhWXLPEFHVjWC64=","attestation":{"playerAttestationRenderer":{"challenge":"a=5\u0026a2=1\u0026b=xR6AML5vOfDxRSgf-
